const MainHeader = () => {
  return (
    <div class="container">
      <div class="row">
        <div class="col">
          <h1>Welcome page here, text, text, text, text,</h1>
        </div>
        <div class="col">
          <p>Eth icon here</p>
        </div>
      </div>

      <div class="row">
        <div class="col">1 of 3</div>
        <div class="col-6">2 of 3 (wider)</div>
        <div class="col">3 of 3</div>
      </div>
    </div>
  );
};

export default MainHeader;
